CREATE DEFINER=`app`@`localhost` PROCEDURE `getFridayRouteF`(routeid int)
BEGIN

set @num = (select count(distinct stop_id) from confirmedstops where route_id = routeid); #the number of stops on the route
create temporary table actual 
select hour(stop_time) as hour, 60/(count(*)/@num) as freal from confirmedstops where route_id=routeid group by hour(stop_time); #frequency of stops per hour for the given route

create temporary table expect
select hour, friday weekday from expectedf where route_id=routeid; #expected frequency for given day

create temporary table results
select a.hour, (a.freal < e.weekday) successes from actual a inner join expect e on a.hour=e.hour; #join expected to actual frequencies

select sum(successes)/count(*) from results; #determine success rate

drop table actual;
drop table expect;
drop table results;

END ;;
DELIMITER ;
