CREATE DEFINER=`app`@`localhost` PROCEDURE `stopdata_per_hour`(in r int, h int)
BEGIN
	set @ct = (select count(*) from (select distinct stop_id from confirmedstops where route_id = r group by stop_id) e);
    SET @tot = (select count(*) from confirmedstops where 
		route_id = r and 
        TIME(stop_time)>TIME(STR_TO_DATE(convert(h, char),'%H')) and 
        TIME(stop_time)<TIME(STR_TO_DATE(convert(h+1, char),'%H')));
	if (@tot > 0) then insert into stop_data values (r, (@tot/@ct), h);
    end if;


END ;;
